  \"2016-07-27T23:03:17.014489\",\n\t\"name\": \"a-study-of-behavior-and-nest-distribution-in-the-shad-island-rookery-missisquoi-national-w\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Shad Island is one of the largest Great
  Blue Heron rookeries on Lake Champlain. Recent concern about the effects of invading
  Double-crested Cormorants has prompted two types of investigations in the Shad Island
  Rookery in 1999 and 2000. A behavioral study was conducted of nesting Great Blue
  Herons and Doublecrested Cormorants to try to determine if there are adverse effects
  of cormorants on nesting herons. A second investigation gathered baseline data on
  the rookery: all nests on Shad Island were identified as either heron or cormorant
  and mapped in 1999. In 2000, all nests were remapped and assessed for activity and
  new nests on nearby Metcalfe Island were also identified and mapped in 2000.\",\n\t\"license_title\":
